SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

DROP TABLE IF EXISTS `migrations`;
CREATE TABLE `migrations` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `migration` TEXT NOT NULL  ,
  `batch` INT NOT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `email` TEXT NOT NULL  ,
  `email_verified_at` DATETIME NULL  ,
  `password` TEXT NOT NULL  ,
  `remember_token` TEXT NULL  ,
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `password_reset_tokens`;
CREATE TABLE `password_reset_tokens` (
  `email` TEXT NOT NULL  ,
  `token` TEXT NOT NULL  ,
  `created_at` DATETIME NULL  ,
  PRIMARY KEY (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `sessions`;
CREATE TABLE `sessions` (
  `id` TEXT NOT NULL  ,
  `user_id` INT NULL  ,
  `ip_address` TEXT NULL  ,
  `user_agent` TEXT NULL  ,
  `payload` TEXT NOT NULL  ,
  `last_activity` INT NOT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `cache`;
CREATE TABLE `cache` (
  `key` TEXT NOT NULL  ,
  `value` TEXT NOT NULL  ,
  `expiration` INT NOT NULL  ,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `cache_locks`;
CREATE TABLE `cache_locks` (
  `key` TEXT NOT NULL  ,
  `owner` TEXT NOT NULL  ,
  `expiration` INT NOT NULL  ,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `jobs`;
CREATE TABLE `jobs` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `queue` TEXT NOT NULL  ,
  `payload` TEXT NOT NULL  ,
  `attempts` INT NOT NULL  ,
  `reserved_at` INT NULL  ,
  `available_at` INT NOT NULL  ,
  `created_at` INT NOT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `job_batches`;
CREATE TABLE `job_batches` (
  `id` TEXT NOT NULL  ,
  `name` TEXT NOT NULL  ,
  `total_jobs` INT NOT NULL  ,
  `pending_jobs` INT NOT NULL  ,
  `failed_jobs` INT NOT NULL  ,
  `failed_job_ids` TEXT NOT NULL  ,
  `options` TEXT NULL  ,
  `cancelled_at` INT NULL  ,
  `created_at` INT NOT NULL  ,
  `finished_at` INT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `failed_jobs`;
CREATE TABLE `failed_jobs` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `uuid` TEXT NOT NULL  ,
  `connection` TEXT NOT NULL  ,
  `queue` TEXT NOT NULL  ,
  `payload` TEXT NOT NULL  ,
  `exception` TEXT NOT NULL  ,
  `failed_at` DATETIME NOT NULL  DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `categories`;
CREATE TABLE `categories` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `slug` TEXT NOT NULL  ,
  `color` TEXT NOT NULL  DEFAULT 'DEFAULT #00b4d8',
  `icon` TEXT NULL  ,
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `projects`;
CREATE TABLE `projects` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `category_id` INT NOT NULL  ,
  `title` TEXT NOT NULL  ,
  `slug` TEXT NOT NULL  ,
  `client` TEXT NULL  ,
  `role` TEXT NULL  ,
  `timeline` TEXT NULL  ,
  `description` TEXT NULL  ,
  `challenge` TEXT NULL  ,
  `solution` TEXT NULL  ,
  `thumbnail` TEXT NULL  ,
  `images` TEXT NULL  ,
  `tags` TEXT NULL  ,
  `tools` TEXT NULL  ,
  `key_improvements` TEXT NULL  ,
  `live_url` TEXT NULL  ,
  `code_url` TEXT NULL  ,
  `status` TEXT NOT NULL  DEFAULT 'DEFAULT draft',
  `featured` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `experiences`;
CREATE TABLE `experiences` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `title` TEXT NOT NULL  ,
  `company` TEXT NOT NULL  ,
  `type` TEXT NULL  ,
  `start_date` TEXT NOT NULL  ,
  `end_date` TEXT NULL  ,
  `description` TEXT NULL  ,
  `technologies` TEXT NULL  ,
  `order` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `location` TEXT NULL  ,
  `featured` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `date_format` TEXT NOT NULL  DEFAULT 'DEFAULT F Y',
  `title_en` TEXT NULL  ,
  `company_en` TEXT NULL  ,
  `location_en` TEXT NULL  ,
  `description_en` TEXT NULL  ,
  `technologies_en` TEXT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `profiles`;
CREATE TABLE `profiles` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `title` TEXT NULL  ,
  `bio` TEXT NULL  ,
  `story` TEXT NULL  ,
  `photo` TEXT NULL  ,
  `email` TEXT NULL  ,
  `phone` TEXT NULL  ,
  `whatsapp` TEXT NULL  ,
  `location` TEXT NULL  ,
  `cv_file` TEXT NULL  ,
  `years_experience` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `total_projects` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `happy_clients` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `awards` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `hobbies` TEXT NULL  ,
  `social_links` TEXT NULL  ,
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `bio_id` TEXT NULL  ,
  `website_title` TEXT NULL  ,
  `favicon` TEXT NULL  ,
  `visible_sections` TEXT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `messages`;
CREATE TABLE `messages` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `email` TEXT NOT NULL  ,
  `subject` TEXT NULL  ,
  `message` TEXT NOT NULL  ,
  `is_read` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `education`;
CREATE TABLE `education` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `institution` TEXT NOT NULL  ,
  `degree` TEXT NOT NULL  ,
  `start_date` TEXT NOT NULL  ,
  `end_date` TEXT NULL  ,
  `description` TEXT NULL  ,
  `gpa` TEXT NULL  ,
  `order` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `location` TEXT NULL  ,
  `is_current` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `date_format` TEXT NOT NULL  DEFAULT 'DEFAULT Y',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `technologies`;
CREATE TABLE `technologies` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `icon` TEXT NOT NULL  ,
  `order` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `is_active` INT NOT NULL  DEFAULT 'DEFAULT 1',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `featured` INT NOT NULL  DEFAULT 'DEFAULT 0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `visitor_logs`;
CREATE TABLE `visitor_logs` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `ip_address` TEXT NULL  ,
  `url` TEXT NULL  ,
  `method` TEXT NULL  ,
  `user_agent` TEXT NULL  ,
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `country` TEXT NULL  ,
  `city` TEXT NULL  ,
  `region` TEXT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `skills`;
CREATE TABLE `skills` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `category` TEXT NULL  ,
  `items` TEXT NULL  ,
  `type` TEXT NOT NULL  DEFAULT 'DEFAULT technical',
  `order` INT NOT NULL  DEFAULT 'DEFAULT 0',
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  `category_en` TEXT NULL  ,
  `items_en` TEXT NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `certifications`;
CREATE TABLE `certifications` (
  `id` INT NOT NULL AUTO_INCREMENT ,
  `name` TEXT NOT NULL  ,
  `name_en` TEXT NULL  ,
  `issuer` TEXT NOT NULL  ,
  `issuer_en` TEXT NULL  ,
  `issued_at` TEXT NOT NULL  ,
  `expiration_date` TEXT NULL  ,
  `credential_url` TEXT NULL  ,
  `description` TEXT NULL  ,
  `description_en` TEXT NULL  ,
  `created_at` DATETIME NULL  ,
  `updated_at` DATETIME NULL  ,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

COMMIT;
